import React, {useEffect, useState} from 'react'
import styled from 'styled-components'

export const Vote = () => {

    return (
        <Container>
            <TitleBox>
                Best ASSETS AP 2025
            </TitleBox>
            <PicturesContainer>
                <Picture src="https://auth.etna-alternance.net/api/users/nakach_v/photo?size=medium"/>
            </PicturesContainer>
        </Container>
    )
}

const Picture = styled.img`
    width: 100px;
    height: 120px;
`

const PicturesContainer = styled.div`
    display: flex;
    width: 80%;
    background-color: red;
    height: 100%;
    margin-top: 100px;
    justify-content: space-between;
`

const TitleBox = styled.div`
    position: fixed;
    display: flex;
    height: 100px;
    width: 100%;
    justify-content: center;
    align-items: center;
    font-size: 30px;
    font-style: bold;
    background-color: #7dbdd4;

`

const Container = styled.div`
    display: flex;

    width: 100%;
    height: 100%;
    justify-content: center;
`
